import React from "react";
import {
  Box,
  Button,
  Card,
  CardContent,
  CardMedia,
  CardActions,
  Chip,
  Typography,
} from "@mui/material";
import { LocationOnIcon, PhoneIcon } from "@mui/icons-material";

const PlaceDetails = ({ place }) => {
  const imageUrl = place.photo ? place.photo.images.large.url : "/chairs-cutlery-fork.webp";
  return (
    /**<h1>{place.name}</h1>**/
    <Card elevation={6}>
      <CardMedia
        style={{ height: 350 }}
        image={
          place.photo
            ? place.photo.images.large.url
            : "/src/chairs-cutlery-fork.webp"
        }
        
        title={place.name}
      ></CardMedia>
      <CardContent>
        <Typography gutterBottom varient="h5">
          {place.name}
        </Typography>
        <Box display="flex" justifyContent="space-between">
          <Typography varient="subtitle1">Price</Typography>
          <Typography varient="subtitle1">{place.price}</Typography>
        </Box>
        <Box display="flex" justifyContent="space-between">
          <Typography varient="subtitle1">ranking</Typography>
          <Typography varient="subtitle1">{place.ranking}</Typography>
        </Box>
      </CardContent>
    </Card>
  );
};
export default PlaceDetails;
